import React from "react";
import "./App.css";
import Navbar from "./../Navbar/Navbar";
import ClassList from "./../ClassList/ClassList";
import PopUp from "./../AddCardPopUp/PopUp";

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            cards: [
                {
                    id: "0",
                    name: "Name 1",
                    image:
                        "data:image/jpeg;base64,",
                },
                {
                    id: "1",
                    name: "Name 2",
                    image:
                        "data:image/jpeg;base64,",
                },
                //{
                //id: "2",
                //name: "Another Name",
                //image: "https://avatars.githubusercontent.com/u/44740407?v=4",
                //},
            ],
            popUp: false,
        };
        this.addCard = this.addCard.bind(this);
        this.removeCard = this.removeCard.bind(this);
        this.openPopUp = this.openPopUp.bind(this);
        this.closePopUp = this.closePopUp.bind(this);
    }

    addCard(
        newCard = {
            id: Math.random() * 100,
            name: "Hello World",
            image: `https://picsum.photos/200`,
        }
    ) {
        newCard.image = `https://picsum.photos/${Math.floor(Math.random() * 100) + 100}`;
        this.setState(function (prevState) {
            return {
                cards: [...prevState.cards, newCard],
            };
        });
        this.closePopUp();
    }

    openPopUp() {
        this.setState({
            popUp: true,
        });
    }

    closePopUp() {
        this.setState({
            popUp: false,
        });
    }

    removeCard(id) {
        this.setState(function (prevState) {
            return {
                cards: prevState.cards.filter((card) => card.id !== id),
            };
        });
    }
    render() {
        return (
            <div className="App">
                <Navbar openPopUp={this.openPopUp} />
                <ClassList cards={this.state.cards} removeCard={this.removeCard} />
                <PopUp
                    addCard={this.addCard}
                    visible={this.state.popUp}
                    closePopUp={this.closePopUp}
                />
            </div>
        );
    }
}

export default App;
